import React, { useEffect, useState } from 'react';
import { useParams, useNavigate } from 'react-router-dom';
import axiosInstance from '../api/axiosConfig';
import Layout from '../components/Layout';
import 'bootstrap/dist/css/bootstrap.min.css';
import '../styles/ListingDetails.css';

function ListingDetails() {
  const { id } = useParams();
  const [listing, setListing] = useState(null);
  const [photos, setPhotos] = useState([]);
  const [user, setUser] = useState(null);
  const [currentImageIndex, setCurrentImageIndex] = useState(0);
  const navigate = useNavigate();

  useEffect(() => {
    axiosInstance
      .get(`/api/listings/${id}`)
      .then((response) => {
        setListing(response.data.listing);
        setPhotos(response.data.photos);
        setUser(response.data.user);
      })
      .catch((error) => {
        console.error('Error fetching listing details:', error);
        navigate('/');
      });
  }, [id, navigate]);

  const handlePrev = () => {
    setCurrentImageIndex((prevIndex) =>
      prevIndex === 0 ? photos.length - 1 : prevIndex - 1
    );
  };

  const handleNext = () => {
    setCurrentImageIndex((prevIndex) =>
      prevIndex === photos.length - 1 ? 0 : prevIndex + 1
    );
  };

  const calculateDuration = (start, end) => {
    const startDate = new Date(start);
    const endDate = new Date(end);
    const diffMonths =
      endDate.getMonth() -
      startDate.getMonth() +
      12 * (endDate.getFullYear() - startDate.getFullYear());
    return diffMonths === 1 ? `${diffMonths} Month` : `${diffMonths} Months`;
  };

  if (!listing) return <p>Loading...</p>;

  return (
    <Layout>
      <div className="listing-details-container">
        <div className="row">
          {/* Image Slider Section */}
          <div className="col-md-6 image-section">
            <div className="slider-container position-relative">
              {photos && photos.length > 0 ? (
                <>
                  <button className="arrow left" onClick={handlePrev}>
                    &#8249;
                  </button>
                  <img
                    src={`http://localhost:9000${photos[currentImageIndex].photo_url}`}
                    alt={`Listing ${currentImageIndex + 1}`}
                    className="slider-image"
                  />
                  <button className="arrow right" onClick={handleNext}>
                    &#8250;
                  </button>
                  <div className="photo-count badge bg-dark text-white">
                    {currentImageIndex + 1} / {photos.length} Photos
                  </div>
                </>
              ) : (
                <p>No images available</p>
              )}
            </div>
          </div>

          {/* Details Section */}
          <div className="col-md-6 details-section">
            <h1 className="fw-bold">${listing.monthly_rent}/mo</h1>
            <h2 className="text-secondary">{listing.title}</h2>
            <p className="text-muted">
              {listing.address}{' '}
              {listing.building_name ? `| ${listing.building_name}` : ''}
            </p>
            <p>
              <strong>Type:</strong> {listing.building_type} |{' '}
              <strong>Beds:</strong> {listing.bedrooms} |{' '}
              <strong>Baths:</strong> {listing.bathrooms} |{' '}
              <strong>Status:</strong>{' '}
              {listing.availability ? 'Available' : 'Not Available'}
            </p>

            <div className="mt-4">
              <h3>Overview</h3>
              <p>{listing.description}</p>
            </div>

            <div className="mt-4">
              <h3>Contact</h3>
              <p>
                <strong>Name:</strong> {user?.name || 'N/A'}
              </p>
              <p>
                <strong>Email:</strong> {listing.contact_email}
              </p>
              <p>
                <strong>Mobile:</strong> {listing.contact_mobile}
              </p>
              <button className="btn btn-primary mt-2">
                Message
              </button>
            </div>
          </div>
        </div>
      </div>
    </Layout>
  );
}

export default ListingDetails;
